(2523, 0, 73, 0, 'Clinicanâ€™s Illusion', 'Vessey JT, Howard KI, Lueger RJ, KÃ¤chele H & Mergenthaler E (1994) The clinicanâ€™s illusion and the psychotherapy practice: An application of stochastic modeling. Journal of Consulting and Clinical Psychology 62 (4): 679-685\r\n', '', '', 'clinician_s_illusion.pdf', '2014-04-03', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-04-24', 1),
(2524, 0, 1097, 0, 'The Menninger Psychotherapy Research Project (PRP)', ' Kernberg, O., Burstein, E. D., Coyne, L., Applebaum, A., Horwitz, L., & Voth, H. (1972). Psychotherapy and psychoanalysis -The final report of the Menninger Foundation\'s Psychotherapy Research Project. Bulletin of the Menninger Clinic, 36, 1-275. \r\nWallerstein, R. S. (1986). Forty-two lives in treatment: A study of psychoanalysis and psychotherapy. New York: Guildford Press. \r\n', '', 'The PRP was launched in the 1950s and it was the first prospective study of long-term psychoanalytic psychotherapy in the United States (Kernberg et al., 1972). Forty two patients originally assigned to expressive or supportive therapies tended to have various combinations of both treatments across the three decades of the study. The investigation which has been reported in a number of books and many papers was concluded with Robert Wallersteinâ€™s definitive report of the long-term follow up, the history of these patients spanning 30 years (Wallerstein, 1986). The sample was too small to permit adequate analysis of the large number of measures and treatment patterns. The findings indicate that some severely personality disordered patients may require psychoanalytic therapy if they are to show significant improvement. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2525, 0, 1096, 0, 'The Berlin I Study â€“ The Fenichel Report ', 'Fenichel, O. (1930). Statistischer Bericht Ã¼ber die therapeutische TÃ¤tigkeit 1920-1930. In S. RadÃ³, O. Fenichel, & C. MÃ¼ller-Braunschweig (Eds.), Zehn Jahre Berliner Psychoanalytisches Institut. Poliklinik und Lehranstalt (pp. 13-19). Wien: Internationaler Psychoanalytischer Verlag. ', '', 'This is the first psychoanalytic outcome study and an early indication of the productivity of this field in Germany. This study has been described in detail in Bergin and Garfield, in the chapter on outcome by Bergin (1971). It forms the basis of Eysenckâ€™s classical critique of psychoanalysis which has recently been shown to exaggerate the speed of spontaneous remission in untreated patients (McNeilly & Howard, 1991). \r\nFor a further report from the Berlin Institute see F. Boehm (1942) on 419 terminated psychoanalytic treatments (for a reference see A. DÃ¼hrssen 1972). ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2526, 0, 1096, 0, 'The New York Psychoanalytic Institute Study (NYPIS) ', 'Erle, J. (1979). An approach to the study of analyzability and the analysis: The course of forty consecutive cases selected for supervised analysis. Psychoanalytic Quarterly, 48, 198-228. \r\nErle, J. & Goldberg, D. (1979). Problems in the assessment of analyzability. Psychoanalytic Quarterly, 48, 48-84. \r\nErle, J.,& Goldberg, D. (1984). Observations on assessment of analyzability by experienced analysts. Journal of the American Psychoanalytical Association, 32, 715-737. \r\n', '', 'This programme of studies was a naturalistic pre-post study using candidates and trained analysts from the New York Psychoanalytic Institute. Outcomes were measured in terms of analystsâ€™ assessments. The first study (N=40) included only neurotic cases whereas the second study contained some more severely disturbed individuals (N=160). Clinicians were only aware of significant improvements in 55-60% of cases but a strong relationship between length of treatment and outcome was found. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2527, 0, 1096, 0, 'The Columbia University Research Project (CURP) ', 'Weber, J., Bachrach, H., & Solomon, M. (1985). Factors associated with the outcome of psychoanalysis: report of the Columbia Psychoanalytic Center Research Project (II). International Review of Psychoanalysis, 12, 127-141. \r\nWeber, J., Bachrach, H., & Solomon, M. (1985). Factors associated with the outcome of psychoanalysis: report of the Columbia Psychoanalytic Center Research Project (III). International Review of Psychoanalysis, 12, 251-262. \r\nBachrach, H. M., Weber, J. J., & Murray, S. (1985). Factors associated with the outcome of psychoanalysis. Report of the Columbia Psychoanalytic Research Center (IV). International Review of Psychoanalysis, 12, 379-389. \r\n', '', 'This was an ambitious study undertaken by the Columbia Center for Psychoanalytic Training and Research contrasting the outcomes of non-randomly assigned psychoanalytic and psychotherapeutic treatments undertaken at Columbia University. The study examined treatment records of trainee cases. It found that the vast majority of patients completing treatment show marked improvement and \r\nthat psychoanalysis achieves greater improvement than psychotherapy but the two groups were not well matched. \r\n', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2528, 0, 1096, 0, 'Anna Freud Centre Studies 2. Chart Review of 765 Cases Treated with Psychoanalysis or Psychotherapy (AFC2) ', 'Fonagy, P., Target, M. (1994). The efficacy of psychoanalysis for children with disruptive disorders. Journal of the American Academy of Child and Adolescent Psychiatry, 33, 45-55 \r\nFonagy, P., Target, M. (1996). Predictors of outcome in child psychoanalysis: A retrospective study of 763 cases at the Anna Freud Centre. Journal of the American Psychoanalytic Association, 44, 27-77 \r\nTarget, M., Fonagy, P. (1994). The efficacy of psychoanalysis for children: Prediction of outcome in a developmental context. Journal of the American Academy of Child and Adolescent Psychiatry, 33, 1134-1144 \r\nTarget, M., Fonagy, P. (1994). The efficacy of psychoanalysis for children with emotional disorders. Journal of the American Academy of Child and Adolescent Psychiatry, 33, 361-371 \r\n', '', 'This was a study of the carefully maintained case records of the Anna Freud Centre, a centre for the psychoanalytic and psychotherapeutic treatment of children under the direction of Anna Freud from 1952 until her death. Case records of the Centre are unusually detailed and to a large extent standardised following Anna Freudâ€™s diagnostic profile (Freud, 1962) and incorporating the Hampstead Index (Sandler, 1962). The charts of 765 cases were reviewed by independent researchers and careful attention was paid to achieving reasonable reliability in judgements. Findings were reported in three papers. Disruptive disordered children did relatively poorly in psychoanalysis and psychotherapy but did better if their presentation included anxiety and if their treatment was completed. Emotionally disordered children did well in both psychoanalysis and psychotherapy and appeared to require analysis if their problems were more severe and complex. On the whole, younger children benefited more from psychoanalytic treatment than older ones. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2529, 0, 1097, 0, 'The Heidelberg Study (A & B): The Heidelberg Psychosomatic Clinic Study â€“ a naturalistic prospective outcome and follow-up study ', 'Rad, v M., Senf, W., BrÃ¤utigam, W. (1998). Psychotherapie und Psychoanalyse in der Krankenversorgung: Ergebnisse des Heidelberger Katamnesenprojektes. Psychotherapie Psychosomatik medizinische Psycholologie 48, 88-100 ', '', 'In the \"Heidelberg Long-term Psychotherapy Follow-up Project\", a naturalistic study design, all types of treatment were included that had been performed at the Psychosomatic Clinic of the University of Heidelberg for a certain period (combined inpatient and outpatient individual and group therapy, as well as outpatient dynamic psychotherapy and psychoanalysis). A specific strength of this project is that three to five individual therapy goals were predetermined for each patient before starting the treatment (Goal Attainment Scaling). After the end of therapy and at the time of follow-up (3.5 years later), attainment of these goals was assessed by an independent rater. A total of 208 patients were examined, among them 36 patient in psychoanalysis (three times as week) who were evaluated according to their diagnosis (neurotic, functional or psychosomatic disorders) and the kind of treatment. Psychoanalysis had superior outcome to psychotherapy but the difference diminished by follow up (four years). Goal Attainment Scaling also highlighted the efficacy of psychoanalysis. A spin-off investigation demonstrated a powerful dose-response relationship between treatment and outcome. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2530, 0, 1097, 0, 'The Heidelberg Study (C): Long-term outcome of out-patient psychoanalytic psychotherapies and psychoanalyses: a study of 53 follow-up interviews ', 'Heuft, G., Seibuechler-Engec, H., Taschke, M., Senf, W. (1996). Langzeitoutcome ambulanter psychoanalytischer Psychotherapien und Psychoanalysen: eine textinhalts-analytische Untersuchung von 53 Katamneseinterviews. Forum der Psychoanalyse: Zeitschrift fuer Klinische Theorie und Praxis, 12, 342-355 ', '', 'A further paper from the Heidelberg group was a contribution to the development of new strategies for follow-up methodology relying on qualitative text analytic strategies and individualised treatment goals. The attainment of individualised treatment goals were compared for psychoanalytic (N=33) and psychoanalytically oriented psychotherapy (N=33) treatments at least two years after termination on the basis of text analysis of an interview. Overall, 72% of patients in analysis and 56% of patients in psychotherapy were rated as having achieved their goals at 2-year follow-up. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2531, 0, 1097, 0, 'The Berlin III Study (A, B & C): A multi-centre study on psychoanalytic oriented treatments ', 'Rudolf, G. (1991). Free University of Berlin: Berlin Psychotherapy Study. In L. Beutler & M. Crago (Eds.), Psychotherapy Research. An International Review of Programmatic Studies. Washington: American Psychological Association. \r\nRudolf, G., Manz, R., & Ori, C. (1994). Ergebnisse der psychoanalytischen Therapien. Zsch Psychosom Med, 40, 25-40. \r\nRudolf, G., & Manz, R. (1993). Zur prognostischen Bedeutung der therapeutischen Arbeitsbeziehung aus der Perspektive von Patienten und Therapeuten. PPmP, Psychother. Psychosom. med. Psychol., 43, 193-199. \r\n', '', 'This was one of the successful products of the research program conducted by the Ministry of Technology (BMFT) in the early eighties. The Berlin III Study was a field study collecting systematic data from patients in out-patient and in-patient psychoanalytic oriented treatments. \r\nWithin a naturalistic design, 44 psychoanalytic treated patients were examined with regard to qualitative and quantitative indicators of outcome. The results were compared to 56 outpatient psychodynamic therapies and 164 inpatient dynamic treatments. A comparison of symptoms, diagnoses and motivations before therapy led to the conclusion that the patient groups in these studies were different at the outset. It was concluded that randomisation to these treatments would not be an adequate strategy. Using various criteria of outcome it was demonstrated that psychoanalytically treated patients improve quite markedly and to a larger extent than out-patients or inpatients treated with psychodynamic therapy. Three studies are reported. The first demonstrates that patients in outpatient psychoanalytic therapy showed improvement in 96% of cases, compared to about 64% of inpatients also in psychoanalytic therapy who showed improvements. Patients who did not finish therapy fared worst in long term follow-up. In the second study, 44 psychoanalytically treated patients were followed. Anxiety and other mood disorder symptoms showed largest effect sizes. In the third study, the therapist perspective on the working alliance was found to be the best predictor of outcome. \r\n', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1);
INSERT INTO `pdf_file` (`files_id`, `subnav_id`, `topic_id`, `sort`, `files_head`, `files_text`, `long_head`, `long_text`, `files_name`, `files_date`, `img`, `img_set`, `tag1`, `tag2`, `tag3`, `tag4`, `tag5`, `date`, `visible`) VALUES
(2532, 0, 1097, 0, 'The Stockholm Outcome of Psychotherapy and Psychoanalysis (STOPP) Study ', 'Sandell, R., Blomberg, J., Lazar, A., Carlsson, J., Broberg, J., & Rand, H. (2000). Varieties of longÂ¬term outcome among patients in psychoanalysis and long-term psychotherapy: a review of findings in the Stockholm outcome of psychoanalysis and psychotherapy project (STOPP). International Journal of Psychoanalysis, 81 (5), 921-943. ', '', 'This study makes use of an innovative 3-wave panel survey design to study 430 patients at various stages of psychoanalysis or psychotherapy (before, during, or after therapy). Treatment modality was self-selected and stage in treatment was considered to be a randomised factor. An extensive battery of measures was used including standardized self-report instruments (SCL-90, SAS, SOCS), specialized questionnaires addressing the patientâ€™s family, health, work, and general condition, and a therapeutic identity questionnaire completed by the therapists. The psychotherapy and psychoanalysis groups started out at similar levels of psychopathology and were both in the non-clinical range by the end of therapy. However, psychoanalytic patients continued to improve while psychotherapy patients did not. Older therapists achieved better outcome than younger ones, though, the second youngest, not the youngest therapists did worst. Therapists who endorsed items that clustered into â€œsupportiveÂ¬interpersonalâ€ or â€œsupportive-intuitiveâ€groups had more success than those in the â€œclassicalâ€ cluster, irrespective of whether they were treating patients in psychoanalysis or psychotherapy. â€œClassicalâ€ therapists did particularly poorly when practicing psychotherapy. This study has fascinating results, though the methodology and data analysis are still new and of uncertain validity. HLM analyses may resolve some of these problems. \r\n', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2533, 0, 1097, 0, 'The Heidelberg-Berlin Study: The DGPT Practice Study on long term psychoanalytic therapy ', 'Rudolf G, Grande T, Dilg R, Jakobsen T, Keller W, Oberbracht C, Pauli-Magnus C, Stehle S & Wilke S (2002) Structural Changes in Psychoanalytic Therapies - The Heidelberg-Berlin Study on Long-Term Psychoanalytic Therapies (PAL). in: Leuzinger-Bohleber, M & Target, M(eds) Outcomes of Psychoanalytic Treatment â€“ Perspectives for Therapists and Researchers. Whurr, London, 201-222.\r\nGrande T, Dilg R, Jakobson T, Keller W, Krawietz B, Langer M, Oberbracht C, Stehle S, Stennes M & Rudolf G (2009) Structural change as a predictor of long-term follow-up outcome. Psychotherapy Research 19 (3): 344-357.\r\n\r\n', '', 'This study has been launched by the membership of the DGPT, a German Psychoanalytic Umbrella Organisation. Two samples of 36 patients with severe disturbance, treated either with psychoanalysis (3-4 times a week) or 1-2 times per week face to face psychotherapy, are currently being studied by a group of investigators who are not involved in the treatment. Every three months an interview is performed and systematic evaluations of the development of symptomatic and structural change are recorded. The study uses the Operational Psychodynamic Diagnosis tool as the major assessment instrument for measuring structural change and the technique of goal attainment using a Heidelberg version of Stiles\' APES. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2534, 0, 1098, 0, 'The Oslo I Study: Schjeldrup (1955): An early proponent of combined questionnaire and personal follow-up interview ', 'Schjeldrup, H. (1955). Lasting effects of psychoanalytic treatments. Psychiatry, 18, 109-133 ', '', 'Schjelderup, a psychoanalyst, treated 28 cases between 1926 until 1943. After the war a questionnaire was sent to his patients; after the questionnaire had been returned an open personal interview was administered \"in which the answers were discussed in great detail and necessary additional information ...was obtained\". \r\nIn nine of these cases the follow-up shows a lasting symptomatic cure, and in an additional 14 a substantial improvement was noted. The most frequent lasting personality changes found were changes in interpersonal relationships (25 cases) and in the capacity for work and the enjoyment of work (22 cases). Changes in capacity for sexual adjustment and in a more realistic perception of reality were also quite common. The results obtained by this early empiricist have been replicated by more recent and systematic investigators. \r\n', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2535, 0, 1098, 0, 'The DÃ¼hrssen study ', 'DÃ¼hrssen, A. (1962) Katamnestische Ergebnisse bei 1004 Patienten nach analytischer Psychotherapie. Zeitschrift fuer Psychosomatrische Medizin 8, 94-113 \r\nDÃ¼hrssen AM & Jorswieck E (1965) Eine empirisch-statistische Untersuchung zur LeistungsfÃ¤higkeit psychoanalytischer Behandlung. Nervenarzt 36: 166-169\r\n', '', 'DÃ¼hrssen (1962) supported the inclusion of psychoanalytic oriented treatment of neurotic disturbance in insurance coverage in Germany by her pioneering analysis of the follow-up of 1,004 patients who had received analytic psychotherapy at the \"Central Institute for Psychogenic Disorders\" in Berlin, in which she showed the effectiveness and efficiency of the treatment (A. M. DÃ¼hrssen & E. Jorswieck, 1965). All but 15% of patients showed improvement, the largest group showing very considerable improvement maintained at follow-up. A substantial reduction in insurance claims for physical problems was associated with psychoanalytic treatment in the 5 year period following therapy. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2536, 0, 1098, 0, 'The Boston Psychoanalytic Institute Study ', 'Sashin, J., Eldred, S., & Van Amerowgen, S. T. (1975). A search for predictive factors in institute supervised cases: a retrospective study of 183 cases from 1959-1966 at the Boston Psychoanalytic Society and Institute. International Journal of Psycho-Analysis, 56, 343-359. ', '', 'This was a study monitoring the outcome of significant number (N=130) of patients treated by trainee analysts under supervision. The patients were selected as good training cases and are therefore not necessarily representative of psychoanalytic cases in general. The large majority of patients were rated as improved although a significant minority terminated before the analyst indicated that this was appropriate. Spin off studies demonstrated that trainees used a variety of techniques and that some improvements were not maintained on follow-up. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2537, 0, 1098, 0, 'The Stuttgart Psychotherapeutic Hospital Follow-Up Study ', 'Teufel, R., & Volk, W. (1988). Erfolg und Indikation stationÃ¤rer psychotherapeutischer Langzeittherapie. In W. Ehlers, H. C. Traue, & D. Czogalik (Eds.), Bio-psycho-soziale Medizin (pp. 331-346). Berlin: Springer-PSZ.Drucke. ', '', 'The Stuttgart Psychotherapeutic Hospital is an exclusively psychoanalytically oriented inpatient treatment facility which since 1967 has had 102 beds and has treated about 300 patients per year. A planned follow-up study of 248 patients identified 147 patients who could be interviewed 3.9 years \r\nafter termination of treatment. Four dimension of outcome were evaluated: (a) attainment of treatment goals, (b) symptom reduction, (c) general well-being and (d) capacity for work. The results indicated that capacity for work and the attainment of treatment goals defined in the opening phase of treatment showed the greatest change. General well being and symptom reduction showed more modest improvements. Importantly, the study was carried out at a time when pharmacological treatments were less readily offered on an adjunctive basis. \r\n', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2538, 0, 1098, 0, 'The Berlin Jungian Study: On the effectiveness and efficacy of outpatient(Jungian) psychoanalysis and psychotherapy -a catamnestic study ', 'Keller W, Dilg R, Westhoff R, Rohner R & Studt HH (1997) Zur Wirksamkeit ambulanter jungianischer Psychoanalysen und Psychotherapien â€“ eine katamnestische Studie. in: Leuzinger-Bohleber, M &\r\nStuhr, U (eds) Psychoanalysen im RÃ¼ckblick-Methoden, Ergebnisse und Perspektiven. Psychosozial, Giessen, 432-453\r\n\r\n', '', 'The main objective of the study aimed at proving the effectiveness of long-term Jungian analyses lasting more than 100 sessions in the treatment practice and examining the stability of treatment results by a follow-up study 6 years after the end of therapy. The results show impressive improvements in both subjective and objective measures. There was a measurable improvement in health insurance claims and improvements on standardised measures of psychological distress (SCLÂ¬90). The pre-treatment data are however not sufficiently reliable for subjective measures to permit comparison. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2539, 0, 1098, 0, 'The German Psychoanalytical Association Study: Longterm effects of psychoanalyses and psychoanalytic therapies -a representative follow-up study ', 'Leuzinger-Bohleber M, Stuhr U, RÃ¼ger B & Beutel M (2003) How to study the quality of psychoanalytic treatments and their long term effects on patients well-being. A representative multiperspective follow-up study. International Journal of Psychoanalysis 84, 263-290\r\n', '', 'The major aim of the project is to study retrospectively patientsâ€™ views of their psychoanalytic experiences and the effects of psychoanalytic treatment at least four years after the end of psychoanalysis or long-term psychoanalytic treatment. Do the subjective views of the former patients correspond to those of their former analysts, to those of independent observers and to the results of tests and questionnaires used in psychotherapy-research? The study approached all members from the German Psychoanalytic Association (DPV) to ask their readiness to participate in a follow-up study. 91% of the therapists approached responded. A great majority (89%) was in favour of the study. 401 of the 453 patients in long term psychoanalytic treatment who finished their treatments with DPV members between January 1990 and December 1993 and who were contacted by their analysts about the study agreed to participate. The samples formed have been demonstrated to be representative. The study has assessed 194 former patients by two long psychoanalytic follow-up interviews and 154 patients by standardised questionnaires. Data were analysed using both qualitative and quantitative methods. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2540, 0, 1097, 0, 'Project TR-EAT: A Multicenter Study of Inpatient Psychodynamic Treatment of Eating Disorders in Germany ', 'KÃ¤chele H, Kordy H, Richard M & Studiengruppe Mz-Ess (2001) Therapy amount and outcome of inpatient psychodynamic psychotherapy of eating disorders. Results of a multi center study across Germany. Psychotherapy Research 11: 239-257\r\n', '', 'In spite of a growing number of studies about the efficacy of psychotherapy in eating disorders, the knowledge about the optimal treatment intensity and duration is sparse. This study investigates (1) factors that determine length of treatment and (2) the effect of treatment duration, and other factors, on treatment outcome. It is a multicenter observational study. The symptomatic status of 1171 patients with an eating disorder was observed for 2.5 years after the beginning of treatment in one of the 43 participating clinics. Length of treatment and treatment outcome was modeled using hierarchical linear models and logistic regression. To control for possible confounding factors, propensity score adjustment was used to compare long and short treatment. At 2.5 year follow-up, 33% of Anorexia patients and 25% of the Bulimia patients were symptom free. Length of treatment varied considerably between and within treatment centers and was related to patient characteristics to a very small degree. Length of treatment in interaction with other patient characteristics had an effect on treatment outcome, treatment intensity was not related to outcome. ', 'Kaechele_Kordy_Richard.pdf', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-11-27', 1),
(2541, 0, 1099, 0, 'The German Consumer Reports Study ', 'Breyer, F., Heinzel, R. & Klein, Th. (1997). Kosten und Nutzen ambulanter Psychoanalyse in Deutschland (Cost and benefit of outpatient analytical psychotherapy in Germany). GesundheitsÃ¶konomie und QualitÃ¤tsmanagement, 2, 59-73 ', '', 'Based on the membership rosters of two German (non-IPA) psychoanalytic societies (DGPT and DGIP), a random sample of 20 % received an invitation to take part in a questionnaire study on their former patients. Fifty per cent of those contacted responded. Of this 50%, half the analysts or patients declined to take part after the study was explained to them. Thus, the final sample of the study was 5% of the total membership â€“ sadly, a rather unrepresentative group. Questionnaires were collected from all participants concerning the outcome of therapy. On the subjects available the reported improvements are marked including substantial savings in general health care. Most significant changes took place between the start of therapy and termination but improvements continued, particularly in self-rated total well-being and quality of relationships between termination and long term (2 years plus) follow up. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2542, 0, 1100, 0, 'The Boston Psychotherapy Study of Schizophrenia ', 'Stanton, A. H., Gunderson, J. G., Knapp, P. H., Vancelli, M. L., Schnitzer, R., & Rosenthal, R. (1984). Effects of psychotherapy in schizophrenia: I. Design and implementation of a controlled study. Schizophrenia Bulletin, 10, 520-563. ', '', 'This was a random allocation controlled study of schizophrenic patients who were offered either supportive psychodynamic psychotherapy or expressive psychodynamic psychotherapy. Both therapies had only limited effects, although supportive therapies achieved higher levels of adaptation and expressive therapy led to greater improvement in psychic functioning. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2543, 0, 1608, 0, 'Juvenile-onset Insulin Dependent Diabetes ', 'Moran, G.S., Fonagy, P. (1987). Psychoanalysis and diabetic control: A single-case study. British Journal of Medical Psychology, 60, 357-372 \r\nMoran, G., Fonagy, P., Kurtz, A., Bolton, A., & Brook, C. (1991). A controlled study of the psychoanalytic treatment of brittle diabetes. Journal of the American Academy of Child and Adolescent Psychiatry, 30, 926-935. \r\n', '', 'This series of studies aimed to establish the relevance of psychoanalytic psychotherapy for children and adolescents with insulin dependent diabetes mellitus who had chronic and pervasive difficulties in maintaining diabetic control. The treatments were intensive but uncontrolled in length with some short term and some long term according to patient need. Patients (N=22) were assigned to psychoanalytic treatment with medical management or medical management alone. Outcome was assessed by objective measures of diabetic control. Treatment was associated with significant improvement, maintained on one-year follow-up. Spin-off studies demonstrated benefits for growth, and the association of blood sugar levels and themes within the patientâ€™s treatment. ', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-29', 1),
(2544, 0, 1100, 0, 'The Munich Psychotherapy of Depression Study (MPDS): Comparing the effects of psychoanalysis and psychotherapy ', 'Huber D, Henrich G, Clarkin J & Klug G (2013) Psychoanalytic versus psychodynamic therapy for depression: A three-year-follow-up study. Psychiatry 76 (2): 132-149\r\n\r\n', '', 'The aim of this study was to investigate the effectiveness of long-term psychoÂ¬analytic and psychodynamic psychotherapies. In a prospective, randomized outÂ¬come study, psychoanalytic (mean duration: 39 months, mean dose: 234 sessions) and psychodynamic (mean duration: 34 months, mean dose: 88 sessions) therapy were compared at post-treatment and at one-, two-, and three-year follow-up in the treatment of patients with a primary diagnosis of unipolar depression. All treatments were carried out by experienced psychotherapists. Primary outcome measures were the Beck Depression Inventory and the Scales of Psychological Capacities, and secondary outcome measures were the Global Severity Index of the Symptom Checklist 90-R, the Inventory of Interpersonal Problems, the Social Support Questionnaire, and the INTREX Introject Questionnaire. Interviewers at pre- and post-treatment and at one-year follow-up were blinded; at two- and threeÂ¬year follow-up, all self-report instruments were mailed to the patients. Analyses of covariance, effect sizes, and clinical significances were calculated to contrast the groups. We found significant outcome differences between treatments in terms of depressive and global psychiatric symptoms, personality functioning, and soÂ¬cial relations at three-year follow-up, with psychoanalytic therapy being more effective. No outcome differences were found in terms of interpersonal problems. We concluded that psychoanalytic therapy associated with its higher treatment dose shows longer-lasting effects. ', 'Huber_et_al_MPS_Psychiatry_2013.pdf', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2015-08-14', 1),
(2545, 0, 1101, 0, '', '', '', '', '', '2014-04-05', 'ODR-4_title.png', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-29', 1),
(2546, 0, 1338, 0, '1 History of Research of Psychoanalysis ', 'Development of a plurality during the one hundred year old history of research of psychoanalysis \r\nBy Marianne Leuzinger-Bohleber\r\n', '', '', 'Leuzinger-Bohleber_Introduction.pdf', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-03-07', 1),
(2547, 0, 1102, 0, '0 Contents', 'Part 1 From past to present. Development of a plurality during the one hundred year old history of research in psychoanalysis by M. Leuzinger-Bohleber.\r\n\r\nConceptual research in psychoanalysis by D. Scarfone.\r\n\r\nPsychoanalytic research in Latin America: Challenges by R. Bernardi. \r\n\r\nPart 2	Methodological and epistemological issues on process and outcome research.\r\n\r\nResearch issues in psychoanalysis by P.Fonagy\r\n\r\nMethodological considerations in evaluating the outcome of psychoanalysis by P. Fonagy.\r\n\r\nPart 3 Descriptions of studies.\r\n\r\na)	Conceptual studies \r\nb)	Clinical case studies\r\nc)	Process Studies\r\nd)	A.	Helping alliance\r\ne)	B.	Transference\r\nf)	C.	Countertransference\r\ng)	D	Therapist\r\nh)	E 	Dream\r\ni)	F	Defense\r\nj)	G.	Attachment\r\nk)	Naturalistic studies\r\nl)	Pre-post studie	\r\nm)	Quasi-experimental studies\r\nn)	Experimental treatment studies\r\no)	Cost-effectiveness studies\r\np)	Neuropsychoanalytical Studies\r\nq)	Further psychoanalytical studies\r\n\r\nPart 4: A metaanalysis on outcome studies on longterm psychoanalytical treatments and psychoanalyses by F. Leichsenring\r\n\r\nPart 5: References\r\n\r\n', '', '', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-29', 1),
(2548, 0, 1105, 0, 'Foreword', 'The first edition of the open door review has been a considerable success. The IPA has sold at cost of reproduction all the copies that were printed. Nevertheless requests have continued to come in, so we had the choice of updating or reprinting. If you look at the expanded sections of the second edition, I hope you will agree with us that a new edition was the only way to go. Considerable progress has been made over the last 3 years, and we felt this should be reflected in the review. We are pleased that the review now exists in 3 languages: Portuguese and Spanish in addition to the English. The interest of Latin-American psychoanalysts in research is also reflected by the many new sections in the current edition reporting work from that region. ', '', '', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2549, 0, 1106, 0, 'Measures', 'n entirely new section on measures has been added under the editorship of John Clarkin, with significant contributions from Andrew Gerber. Measurement methodology continues to be an urgent need for many experienced as well as novice researchers. Providing accounts of some of the most frequently used psychoanalytic instruments seems helpful and appropriate. Note that a number of measures, particularly those related to the monitoring of psychoanalytic process, are listed in the Appendix. This has enabled us to link them to studies where they have been applied at the same time as gathering them in one place for easy identification. \r\n', '', '', '', '2014-04-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-06', 1),
