(2554, 0, 1131, 0, 'FRAMES ', 'Dahl, H. & Teller, V. (1994). The characteristics, identification and application of FRAMES. Psychotherapy Research, 4, 252-274. \r\nHÃ¶lzer, M. & Dahl, H. (1996). How to find FRAMES. Psychotherapy Research, 6, 177-197. \r\nDahl, H. (1998). The voyage of el Rubaiyat and the discovery of FRAMES. In R. Bornstein & J. Masling (Eds.), Empirical Studies of the Therapeutic Hour, 179-227. Washington, DC: American Psychological Association. \r\n', '', 'This programme of work is rooted in a theory of emotions. FRAMES are models for mental structures with the capacity to communicate clinical predictions and model changes in the patient over the course of the clinical process. The methods and procedures for reliably identifying FRAMES have been applied to transcripts of treatment hours, structured interviews, reported behaviour, and the observed behaviour of children. This programme of work concerns an innovative systematising construct but although considerable research has been conducted using the FRAMES method, its application so far has been limited to a restricted amount of clinical material, although more work is underway. ', '', '2014-04-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-05-05', 1),
(2555, 0, 1112, 0, 'Core Conflictual Relationship Theme (CCRT) Method ', 'Luborsky, L., & Crits-Christoph, P. (1998). Understanding transference: The core conflictual relationship theme method. (2nd ed.). Washington, DC: American Psychological Association Press. ', '', 'The CCRT is the longest established empirical method for deriving patients\' central relationship pattern from clinical material (Luborsky, 1977). The patient\'s transference is usually inferred from material in treatment sessions and coded in terms of a standardised typology of (a) wishes, (b) anticipated responses from others and (c) responses from the self. The CCRT has good reliability and validity. The CCRT has been widely used to explore the relationship pattern manifested in contexts beyond the therapeutic relationship including dreams and childhood narratives. ', '', '2014-04-06', 'Luborsky_&_Crits.jpg', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-06', 1),
(2556, 0, 1112, 0, 'FRAMES', 'Dahl, H. & Teller, V. (1994). The characteristics, identification and application of FRAMES. Psychotherapy Research, 4, 252-274. \r\n', '', '', '', '2014-04-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-06', 1),
