(2558, 0, 1112, 0, 'The Therapeutic Cycles Model (TCM) in Psychotherapy Research: Theory and Measurement ', 'Mergenthaler, E. (1996). Emotion-abstraction patterns in verbatim protocols: A new way of describing therapeutic processes. Journal of Consulting and Clinical Psychology 64: 1306-1318. ', '', 'This study aims to provide models of therapeutic processes that prototypically define the interplay of change agents and describe their temporal sequence. It uses computer assisted content analysis tools. The TCM makes use of two change agents, Affective Experiencing and Cognitive Mastery measured as \"Emotion Tone\" and \"Abstraction\" in the verbal expressions of patient and therapist in verbatim transcripts. It defines a prototypical cycle of Emotion-Abstraction Patterns which can be compared with real sequences to allow critical moments to be pinpointed. It can be used to analyse both whole therapies and individual sessions. \r\nMergenthaler, E. (1998). CM -the Cycles Model software. (Version 1.0). Sektion Informatik in der Psychotherapie. Ulm, Germany, UniversitÃ¤t Ulm. ', '', '2014-04-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-06', 1),
