(2560, 0, 1116, 0, 'short-term psychodynamic psychotherapy for depression', 'Driessen E, Cuijpers P, De Maat SC, Abbass A, De Jonghe F & Dekker J (2009) The efficacy of short-term psychodynamic psychotherapy for depression: A meta-analysis. Clinical Psychology Review doi: 10.1016./j.cpr.2009.08.010: \r\n', '', '', 'Depression_Metaanalysis.pdf', '2014-04-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-08', 1),
(2561, 0, 1117, 0, 'long-term psychotherapy', 'de Maat, Saskia , Dekker, Jack , Schoevers, Robert and de Jonghe, Frans(2007) \'The effectiveness of long-term psychotherapy: Methodological research issues\', Psychotherapy Research, 17: 1, 59 â€” 65', '', 'In evidence-based medicine (EBM) hierarchy, randomized controlled trials (RCTs) are ranked higher than cohort studies. However, cohort intervention studies are frequently, and RCTs rarely, used to investigate long-term psychotherapy (LTP). The authors compare the two methods and provide critical discussion of their acceptability, feasibility, and decisive power in LTP. The only essential and unchangeable difference between RCTs and cohort studies is that the former always include randomized control groups and the latter never do, giving RCTs a head start on internal validity that cohort studies cannot match. However, randomization nearly always has dramatic consequences for LTP research: The control conditions that are most informative (no treatment, wait list, placebo) are so unacceptable for the patients that decisive RCTs are, in most cases, unfeasible, but more feasible RCTs are less decisive. In contrast, the decisive power of cohort studies is determined by their methodological quality and knowledge of the natural course of the investigated disorders. Cohort studies are as capable as RCTs of meeting all quality criteria for intervention research, except for randomization. The knowledge of the natural course of the disorders suitable for LTP treatment is limited but not nonexistent. In most cases of LTP research, decisive RCTs present insurmountable, method-inherent feasibility problems and represent not the highest but rather an irrelevant level of evidence. The authors conclude that cohort studies provide the best available evidence.', 'de_Maat_long_term_therapy.pdf', '2014-04-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-08', 1),
(2562, 0, 1116, 0, 'STP in Specific Psychiatric Disorders', 'Leichsenring F, Rabung S & Leibing E (2004) The efficacy of short-term psychodynamic psychotherapy in specific psychiatric disorders. A meta-analysis. Archives of General Psychiatry 61: 1208-1216\r\n', '', 'Das als abstract eingefÃ¼gte Bild mÃ¼sste als Langtext hier eingefÃ¼gt werden.', 'Leichsenring_Rabung_Leibing_Archives_2004.pdf', '2014-04-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-30', 1),
(2563, 0, 1108, 0, 'McGlashan Semistructured Interview (MSI)', 'Goin MK, Strauss GD & Martin R (1995) A change measure for psychodynamic psychotherapy outcome research. Journal of Psychotherapy Practice & Research 4 (4): 319-328\r\n', '', 'Explored the utility of the McGlashan Semistructured Interview (MSI) in assessing outcome in outpatient psychodynamic psychotherapy. 10 patients (20-49 yrs) videotaped MSI interviews before and after 8-10 mo of psychodynamic psychotherapy. These tapes and the results of the Symptom Checklist-90 (SCL-90) were studied and compared. Two investigators scored the interviews (interrater reliability = 0.91). MSI scores were sensitive to both improvement and decrease in function. Changes in the SCL-90 did not always reflect the same amount or direction of change as the MSI. Preliminary evidence suggests the MSI is sensitive to change and can track both improvement and regression, indicating the value of its further use in larger outcome studies. (PsycINFO Database Record (c) 2000 APA, all rights reserved) ', '', '2014-04-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-30', 1),
(2564, 0, 1111, 0, 'Adult Attachment Representation in an fMRI Environment', 'Buchheim A, George C, KÃ¤chele H, Erk S & Walter H (2006) Measuring adult attachment representation in an fMRI environment: concepts and assessment. Psychopathology 39: 136-143\r\n', '', 'Human attachment is defined as a biologically based behavioural system that influences motivational, cognitive, emotional, and memory processes with respect to intimate relationships (parents, life partner, own children). Recent neurobiological studies in this field have in common that they investigated social relationships by examining fMRI neuroimaging patterns while individuals viewed pictures of their beloved relationship partner versus friends, acquaintances, strangers or mothers responses to their young children. The researchers showed that the neural underpinnings of these unique intimate emotional states are linked to functionally specialized areas in the brain. Conceptualizing this work from a behavioral systems-attachment theory perspective, these studies did not directly address the subjectÂ´s attachment representational system. Traditional attachment theory and research has been built on the analysis of attachment narratives, called â€œattachment representation.â€ The Adult Attachment Projective (AAP) developed by George & West (2001) is a set of attachment-based schematic pictures. It is constructed to increasingly activate the participantâ€™s attachment system in the course of the task, that is, by the introduction of increasingly stressful attachment scenes concluding with pictures of individuals faced death and potential abuse alone. The attachment patterns are evaluated based on individualsâ€™ overall verbal response to the picture set. This paper proposes that the AAP is a fruitful measure to use in an fMRI environment to examine brain activation patterns in adults while they are speaking overtly about attachment stories in a standardized setting. ', 'Buchheim_Attachment_fMRI.pdf', '2014-04-08', 'fMRT_Fig_1.jpg', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-08', 1),
