(3091, 0, 1269, 0, 'Bowlby s Distinction: Scientist & Practitioner', 'â€žIn his day work it is necessary for a scientist to exercise a high degree of criticism and selfcriticism: and in the world he inhabits neither the data nor the theories of a leader, however admired personally he may be, are exempt from challenge and criticism. There is no place for authority. ', '', '\r\nThe same is not true in the practice of a profession. \r\n\r\nIf he is to be effective a practitioner must be prepared to act as though certain principles and certain theories were valid; and in deciding which to adopt he is likely to be guided by those with experience from whom he learns. Since, moreover, there is a tendency in all of us to be impressed whenever the application of a theory appears to have been successful, practitioners are at special risk of placing greater confidence in a theory than the evidence available may justify (p. 4)\r\n\r\nBowlby J (1979) Psychoanalysis as art and science. International Review of Psychoanalysis 6: 3-14\r\n\r\n\r\n\r\n\r\n', '', '2015-11-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2015-11-08', 1),
