(3190, 0, 1313, 0, 'Message from the President', 'Dear Horst,\r\n\r\nafter becoming a component society of the IPA in Boston we (Moscow Psychoanalytic Society) looked back to remember our way and people without whom our mission would have been impossible! \r\nWith deep gratitude WE WOULD LIKE TO SHARE WITH YOU some moments of  \"history in pictures and almost without words\" of the times YOU HAVE SHARED WITH US luxury and hardships of learning, communication and inspiration in psychoanalysis. Thank you for your vigor and generosity!\r\nhttps://drive.google.com/file/d/0B-reRA51KbujWU1kZElKLUdtc28/view?usp=sharing\r\n\r\nWe wish you Merry Christmas and fruitful and happy New Year!\r\nOn behalf of MPS \r\nCordially, Tatjana Alavidze', '', '', '', '2015-12-25', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-12-21', 1),
