(3343, 0, 1359, 0, 'KÃ¤chele, Horst: The Shadow of the Past on the Present', 'The Shadow of the Past on the Present \r\n\r\nThe report deals with the issue of past and present reality in the psychoanalytic treatment of a psychologist who came for depressive symptoms following the rejection for psychoanalytic training. The actual professional and personal reality of the patient could be characterized by a strong denial of her family history. Her father had been working as an SS-officer in HitlerÂ´s retreat on the Obersalzberg. After the end of the Third Reich he successfully supported by the patientÂ´s family could leave behind his political involvement. The impact on the patient Â´s psychosexual development will be detailed in the presentation. It took some years of analytic work to help the patient to get in touch with the shadows of the past.\r\n\r\n\r\nNazi SS SubayÄ± babasÄ±nÄ±n bastÄ±rÄ±lmÄ±ÅŸ anÄ±larÄ±yla aÅŸÄ±lanmÄ±ÅŸ iÃ§ dÃ¼nyasÄ±na Ã§arpÄ±cÄ± bir ÅŸekilde karÅŸÄ± konumdaki sol gÃ¶rÃ¼ÅŸlÃ¼ psikoloji Ã¶ÄŸrencisi\r\n\r\nBu Ã§alÄ±ÅŸma; bir psikoloÄŸun psikanalitik eÄŸitimin reddedilmesini takiben depresif semptomlarla baÅŸvurduÄŸu psikanalitik Ã§alÄ±ÅŸmasÄ±ndaki geÃ§miÅŸ ve gÃ¼nÃ¼mÃ¼ze dair\r\ngerÃ§eklikle ilgilidir. HastanÄ±n gÃ¼ncel profesyonel ve kiÅŸisel gerÃ§ekliÄŸi kendi aile hikayesini kuvvetli bir ÅŸekilde reddetmesiyle iliÅŸkilendirilebilir. Bayan hastanÄ±n babasÄ± Hitlerâ€™in Obersalzbergâ€™e geri Ã§ekildiÄŸi dÃ¶nemde SS-subayÄ± olarak Ã§alÄ±ÅŸÄ±yordu.\r\nÃœÃ§Ã¼ncÃ¼ Nazi dÃ¶nemi sonlandÄ±ktan sonra, hastanÄ±n babasÄ± evde baÅŸarÄ±lÄ± bir ÅŸekilde desteklenerek, politik faaliyetlerini geride bÄ±rakabildi. HastanÄ±n psikoseksÃ¼el geliÅŸiminin detaylarÄ±na sunumda yer verilecektir. HastanÄ±n geÃ§miÅŸinin gÃ¶lgesiyle \r\ntemas etmesine yardÄ±m etmek birkaÃ§ yÄ±l sÃ¼ren analitik Ã§alÄ±ÅŸmayla mÃ¼mkÃ¼n oldu. \r\n', '', '', 'The_Shadow_of_the_Past_on_the_Present.pdf', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
