(3346, 0, 1359, 0, 'FiÅŸek, GÃ¼ler Okman: PsiÅŸik GerÃ§ekliÄŸin DÄ±ÅŸ GerÃ§eklik OlduÄŸu Nokta: MaÄŸduriyet ve DirenÃ§.', 'Bu yazÄ± iÃ§ ve dÄ±ÅŸ gerÃ§eklik sorununu kuramsal deÄŸelendirmeler ve bir klinik vaka sunumu yoluyla ele almaktadÄ±r. Ã–ykÃ¼sÃ¼ ailesel travmasÄ± kadar kendi iÃ§ Ã§atÄ±ÅŸmalarÄ±nÄ± da yansÄ±tan bir kadÄ±n danÄ±ÅŸanÄ±n durumu ele alÄ±nacaktÄ±r. Konu Freudâ€™un klasik duruÅŸundan gÃ¼nÃ¼mÃ¼zÃ¼n Ã¶znelliklerarasÄ±lÄ±k yaklaÅŸÄ±mÄ±na kadar gelen kÄ±sa ve kÄ±smi bir tarihsel bakÄ±ÅŸla tartÄ±ÅŸÄ±lacaktÄ±r. AmaÃ§ bugÃ¼nÃ¼n dÃ¼nyasÄ±nda klinisyenleri karÅŸÄ±layan bazÄ± sorularÄ± ele almak olacaktÄ±r.\r\n\r\n Where Psychic Reality is External Reality: Victimization and Resistance\r\nThis paper discusses the issue of psychic versus external reality through both theoretical considerations and a clinical case material. The case of a woman whose story reflects both her familial trauma and her internal struggles is presented. A brief and partial historical look at the issue from Freudâ€™s classical stance to todayâ€™s intersubjective ethos aims to cover some questions facing clinicians in todayâ€™s world. \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3347, 0, 1359, 0, 'SÌ§ahin, Alper ', 'GerÃ§eklik ve Psikanalitik AraÅŸtÄ±rmalar\r\n\r\nPsikanalitik bilgiyi nasÄ±l ediniyoruz? Bu bilginin geÃ§erli gÃ¼venilir ve genelleÅŸtirilebilir olduÄŸunu sÃ¶yleyebilir miyiz?\r\nGreen Freudâ€™un eserlerinde ampirik araÅŸtÄ±rmalardan hiÃ§ bahsedilmediÄŸini sÃ¶ylerken Freudâ€™un son derece yetkin bir araÅŸtÄ±rmacÄ± olarak nÃ¶roloji labaraturlarÄ±nda Ã§alÄ±ÅŸtÄ±ÄŸÄ±nÄ± ve yayÄ±nlar yaptÄ±ÄŸÄ±nÄ± Makari ifade edilmektedir. Ancak klinik vaka Ã§alÄ±ÅŸmalarÄ±nÄ±n dÄ±ÅŸÄ±nda deneysel Ã§alÄ±ÅŸmalar psikanaliz tarihinin yakÄ±n zamanlarÄ±na kadar gÃ¶rÃ¼lmez. Peki neden son zamanlarda ampirik Ã§alÄ±ÅŸmalar yapmak psikanaliz camiasÄ± iÃ§in Ã¶nemli olmuÅŸtur? Psikanaliz alanÄ±nda bilimsel araÅŸtÄ±rma yapma konusu yÃ¶ntemle ilgili tartÄ±ÅŸmalarÄ± beraberinde getirmektedir. Neden psikanalitik araÅŸtÄ±rmalar tek vaka araÅŸtÄ±rmalarÄ± gibi niteliksel araÅŸtÄ±rmalar ile sÄ±nÄ±rlÄ± kalmÄ±ÅŸtÄ±r? Psikanaliz nasÄ±l bir bilimsel disiplidir? Yoksa diÄŸer bilim alanlarÄ±ndan yalÄ±tÄ±lmÄ±ÅŸ kendi paradigmasÄ± iÃ§ine kapanmÄ±ÅŸ bir sanat/zanaat alanÄ± mÄ±dÄ±r? EÄŸer bilimsel bir disiplin ise kendi epistemolojisi ve araÅŸtÄ±rma yÃ¶ntemleri var mÄ±dÄ±r? Ya da hangi araÅŸtÄ±rma yÃ¶ntemlerini kendi disiplini iÃ§inde ve ne ÅŸekilde kullanmaktadÄ±r? BÃ¼tÃ¼n bu sorularÄ±n psikanaliz Ã§alÄ±ÅŸmalarÄ±na yararÄ± nedir? Bu Ã§alÄ±ÅŸma Psikanalitik gerÃ§eklik sorunsalÄ±ndan yola Ã§Ä±karak psikanaliz ve bilimsel araÅŸtÄ±rma konularÄ±nÄ± Psikanalizin temel varsayÄ±mlarÄ± baÄŸlamÄ±nda tartÄ±ÅŸmayÄ± amaÃ§lamaktadÄ±r.\r\n\r\nThe Reality and Psychoanalytical Research\r\n\r\nHow do we get psychoanalytical knowledge? Is knowledge reliable, valid and generalizable? Even though Green pointed out that Freud do not mention about â€œResearchâ€ in his works (in Standard Edition), Makari reminds that Freud was a successful researcher with his publications on neurology. Nonetheless empirical research is not common in the psychoanalytical environments till nowadays, even though clinical case presentations formed the main area of scientific evidences. So, why lately empirical researches became more popular in the psychoanalytic environments? The matter of researching in psychoanalysis brings the problematic of methodology to the discussion. Why psychoanalytical researches were only limited in the qualitative research methodology? What kind of scientific discipline is psychoanalysis? Or is it a art/craft isolated from scientific knowledge and closed in its own paradigm. If it is a scientific discipline has it its own epistemology and methodology? Or what kind of research methodologies and how it uses in the discipline? What kinds of contributions are expected from all these questions to the psychoanalytical works? This presentation aims to discuss psychoanalysis and scientific research matter basing on reality problematic and in terms of basic psychoanalytical assumptions.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3348, 0, 1359, 0, 'Buchholz, Michael â€œConversational errors â€“ looking at the details of how psychotherapists talk in typical problematic situations (TPS)â€', '\r\n\r\nOften therapists are confronted with typical difficult situations (TPS) that can be described macroanalytically (patient comes late, does not want to talk about relevant topics, bill is not payed etc.). However, there are many more TPS that can be described micro-analytically only. The CEMPP-Project (Conversation Analysis of Empathy in Psychotherapy Process) delivers data on these TPS. Some of them will be presented and clinical proposals are made how to handle them.\r\n\r\nâ€œKonuÅŸma hatalarÄ± â€“ Psikoterapistlerin tipik problemli durumlarda nasÄ±l konuÅŸtuklarÄ±nÄ±n detaylarÄ±na bakmakâ€\r\n\r\nGenellikle, terapistler makro analitik (hastanÄ±n geÃ§ gelmesi, ilgili konular hakkÄ±nda konuÅŸmak istememesi, Ã¼cretin Ã¶denmemesi vb.) olarak tanÄ±mlanan tipik zor sÃ¼reÃ§lerle (TPS) karÅŸÄ± karÅŸÄ±ya kalÄ±rlar. Buna raÄŸmen, daha birÃ§ok mikro analitik olarak tanÄ±mlanabilecek tipik zor sÃ¼reÃ§ler vardÄ±r. Psikoterapi sÃ¼recindeki empatinin konuÅŸma analizi- CEMPP Projesi (Conversation Analysis of Empathy in Psychotherapy Process) tipik zor sÃ¼reÃ§ler Ã¼zerinde veri sahibi olmamÄ±zÄ± saÄŸlar. Bu verilerden bazÄ±larÄ± sunulacak ve bunlarla nasÄ±l baÅŸa Ã§Ä±kÄ±lacaÄŸÄ±na dair klinik Ã¶neriler yer alacaktÄ±r.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3349, 0, 1359, 0, 'Sahhar, Nicola', 'â€œEroticized Transference as a search for a rational home for being: Changes in \r\nunderstanding during a course of analytic psychotherapy.\r\n\r\nEroticized transference in traditional psychoanalytic literature is regarded as a complex form of transference involving reality distortions serving complex defensive needs. These transferences present great challenges during treatment and sometimes have led analysts to consider such patients incurable.\r\n\r\nThis paper describes a course of long term psychoanalytic treatment with a woman of Arabic origin in her mid-thirties, during which the understanding of eroticized transference had to be significantly shifted from its traditional conceptualization. While in the beginning of the treatment the notion of reality distortion had guided the analyst, another meaning of the expressed erotic currents crystallized. Instead of distortions they have been understood as expressions of authenticity. Moreover, the therapistâ€™s own defenses and emotional responses became another core of change. Thus, this course of psychoanalytic treatment illustrates Brandchaftâ€™s ideas described in: Toward an Emancipatory Psychoanalysis (2010).\r\n\r\nâ€œVar olabilmek iÃ§in erotik aktarÄ±m arayÄ±ÅŸÄ±: Psikanalitik Psikoterapi SÃ¼recindeki DeÄŸiÅŸimleri Anlamakâ€¦\r\n\r\nKlasik psikanaliz literatÃ¼rÃ¼nde; erotik aktarÄ±m, savunma mekanizmalarÄ±na hizmet eden gerÃ§eklikte Ã§arpÄ±klÄ±k iÃ§eren aktarÄ±m biÃ§imi olarak ele alÄ±nÄ±r. Bu aktarÄ±m biÃ§imleri, tedavide\r\nmÃ¼cadele gerektiren durumlar yaratÄ±r ve hatta psikanalistleri bu hastalarÄ±n iyileÅŸtirilemeyeceÄŸini dÃ¼ÅŸÃ¼ndÃ¼rtÃ¼r.\r\n\r\nBu Ã§alÄ±ÅŸma, Arap asÄ±llÄ± otuzlarÄ±nÄ±n ortasÄ±nda olan bir bayan hastayla uzun soluklu psikanaliz\r\nÃ§alÄ±ÅŸmasÄ±nda; erotik aktarÄ±mÄ±n geleneksel tanÄ±mlanmasÄ±ndan farklÄ± bir biÃ§imde anlaÅŸÄ±lmasÄ±nÄ± ele alÄ±r. Ã‡alÄ±ÅŸmanÄ±n baÅŸlangÄ±cÄ±nda psikanaliste gerÃ§eklikteki Ã§arpÄ±klÄ±k fikri yÃ¶n verse de, ifade edilen erotik akÄ±m belirgin hale geldi. Erotik akÄ±m, Ã§arpÄ±klÄ±klar yerine, otantikliÄŸin ifadesi olarak anlaÅŸÄ±ldÄ±. AyrÄ±ca; analistin kendi savunmalarÄ± ve duygusal cevaplarÄ± da deÄŸiÅŸimin ayrÄ± bir Ã§ekirdeÄŸi haline geldiler. BÃ¶ylelikle; psikanaliz Ã§alÄ±ÅŸmasÄ±, Brandchaftâ€™Ä±n â€œÃ–zgÃ¼rleÅŸtirici Psikanalize DoÄŸruâ€ (2010) fikirlerine Ã¶rnek teÅŸkil eder.\r\n\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3350, 0, 1359, 0, 'Reghintovschi, Anatol', 'A Dreaming Body\r\n\r\nIn the paper, a fragment from a psychoanalytic psychotherapy offers support for a hypothesis regarding hypochondria and mystification. The assumption made here regards one movement, involving a thought without a thinking process to engage it. Also it opens a perspective over self-deception and probes the form and function of paradox, infused at interpersonal level. In asking how deceiving oneself self-induces mental pain and how this pain is able to travel between minds, what becomes clear is that the process equates a complex process through which a body is given to a dream.  \r\n\r\nRÃ¼ya GÃ¶ren â€“ Hayal Kuran Beden \r\n\r\nBu Ã§alÄ±ÅŸma, psikoanalitik psikoterapi iÃ§inden bir alÄ±ntÄ±da; hipokondria ve mistisizm iÃ§in destek saÄŸlar. Buradaki varsayÄ±m tek bir adÄ±m iÃ§erir: DÃ¼ÅŸÃ¼nme sÃ¼reci olmaksÄ±zÄ±n yer alan dÃ¼ÅŸÃ¼nceâ€¦ Bu durum aynÄ± zamanda kiÅŸinin kendi kendini yanÄ±ltmasÄ± ve kiÅŸiler arasÄ± dÃ¼zeyde paradoks bir form ve iÅŸlevle sonlanan iÃ§iÃ§e geÃ§en bir perspektif saÄŸlar. KiÅŸinin kendini aldatmasÄ± zihinsel acÄ±yÄ± uyarÄ±r ve bu acÄ± zihinler arasÄ±nda gezinebilir. Net bir biÃ§imde ortaya Ã§Ä±kan ÅŸey, bedenin hayale/rÃ¼yaya kendini bÄ±rakÄ±ÅŸÄ±na denk dÃ¼ÅŸen karmaÅŸÄ±k bir sÃ¼reÃ§tir.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3351, 0, 1359, 0, 'KaraburÃ§ak Ãœnsal, Zehra', 'WHEN THE GAS LEAKS INTO THE ROOM\r\n\r\n The psychoanalytic frame, as described by Freud, represents the set of rules required for the well functioning of the psychoanalytic process. Part of them consists of the technical regulations such as the frequency of sessions, their length, the mode of payment etcâ€¦ while another part containing free association, principles of neutrality, abstinence and inhibition of action helps the analysand to reach while talking, his/her unconscious memories, fantasies and also, the appearance of the transference phenomenon via the projection of the analysandâ€™s representations to a nearly blank screen. The frame remains silent and deaf as far as no transgression appears : for the analysand it is a special situation never encountered in current life; a setting he/she accepts without questioning and tries to handle by himself.\r\nBut along with the new developments in the psychoanalytic practice, this constant setting that does not carry any particular process and thus cannot be analyzed gained a new quality. Especially Blegerâ€™s new elaboration of the frame placed the frame to the position of both a container and the object of transference. The direct link between counter transference and frame was largely emphasized. The frame was considered as the place where the analystâ€™s inner frame was externalized and came about hence we began to say that the counter transference came before the transference. Thinking about the frame could not be done without taking into account the leaking of the analystâ€™s counter transferential parts into the analysandâ€™s inner psychic reality.  Thus the frame itself became the object of analysis.\r\nThis new approach brings in the problem of the role played by the actual reality during the analytic process. At the beginning the intrusion of outer and actual reality was considered as a resistance but in this presentation I would like to point out that the avoidance of the actual can be a way of denial itself and also a resistance. In opposition to classical psychoanalytic practice in which the analyst tries to hold on very strictly to the frame and refrains himself/herself on giving anything but interpretations, it is very important to see that the infiltrations and collusions created by the errors or transgressions of the analyst have transformative and deepening effects in the analytic process. \r\nEspecially if both the analyst and the analysand are sharing the same actualityâ€¦\r\nOur confrontation with this difficult matter really began with the Gezi events. We psychoanalysts were deeply concerned about the frame, the counter transferantial collusions, the collective trauma and the actual. This new and quite unusual situation provoked very enriching discussions concerning psychoanalytic theory and practice. \r\nIn this presentation these concepts are going to be discussed with the help of certain clinical vignettes, taking into account the various  psychic experiences related to the different phases starting with the Gezi events until todayâ€™s current situation and their reflections into the analytic process.    \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
