(3360, 0, 1360, 0, 'FiÅŸek, Prof. Dr. GÃ¼ler Okman ', 'GÃ¼ler Okman FiÅŸek received her doctorate in clinical psychology in 1973, and  worked in the United States as a licensed clnical psychologist until 1977, when she returned to Turkey. Since then she has been at the Department of Psychology, BoÄŸaziÃ§i University, where she is now an emeritus professor.\r\n\r\nFiÅŸek was the founder and director of the Center for Psychological Research and Services at BoÄŸaziÃ§i University between 1994-1998 and 2001-2009. She was the Chair, Academic Accreditation Task Force, Turkish Psychological Association, 2006-2014. She was the Representative of the Turkish Psychological Association to the European Federation of Psychologistsâ€™ Associations (EFPA) Standing Committee on Psychotherapy, and convenor of the National Accreditation Committee for the certificate of â€œpsychologist with an expertise in psychotherapyâ€, 2008- 2012. She is a member of the EFPA EuroPsy European Awarding Committee for Psychotherapy since 2010. She is a member of TTurkish Psychological Association, The Turkish-German Association for Psychiatry and Psychology, The International Association of Relational Psychoanalysis and Psychotherapy, and an international affiliate of The American Psychological Association., \r\n\r\nHer work has been on self development and family relations in cultural context, psychotherapy process, relational psychoanalysis and psychotherapy; and she continues to work in these areas.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
