(3623, 0, 1663, 0, 'Insel Â´s Self-Critic', 'Former NIMH head Insel acknowledges that the RDoC funding priority has not resulted in moving the field closer to his hoped-for goal of â€œprecision medicine for psychiatry.â€\r\n\r\n â€œI spent 13 years at NIMH really pushing on the neuroscience and genetics of mental disorders, and when I look back on that I realize that while I think I succeeded at getting lots of really cool papers published by cool scientists at fairly large costsâ€”I think $20 billionâ€”I donâ€™t think we moved the needle in reducing suicide, reducing hospitalizations, improving recovery for the tens of millions of people who have mental illness,â€ Insel says. â€œI hold myself accountable for that.â€\r\n\r\nFor more on this and what Insel is currently up to, see:\r\n\r\nhttps://www.wired.com/2017/05/star-neuroscientist-tom-insel-leaves-google-spawned-verily-startup/?mbid=social_twitter_onsiteshare', '', '', '', '2017-05-25', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-25', 1),
