(3640, 0, 1457, 0, 'PresidentÂ´s Decree 1996', 'The Institute has worked out the presidential decree â€œAbout Revival and Development of Philosophical, Clinical and Applied Psychoanalysis in Russiaâ€ #1044 dated back by July 19, 1996 and, as accomplishment of this decree, the scientific program â€œThe Revival and Development of Psychoanalysis in Russiaâ€ approved by Ministry of Healthcare, Ministry of  Education, Ministry of Science and Russia Academy of Science. The first educational programs in psychoanalysis have been worked out in the Institute. ', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3641, 0, 1457, 0, 'Research Activities', ' The Institute carries out different projects in such fields as psychotherapy, sociopsychology, socioeconomics and polithology. Among our customers are the Administration of Russian President, the Russian Government, the Ministries of Healthcare and Education, the St.-Petersburg City Hall, leading state and commercial structures and mass media. The Institute research fellows published 7 scientific books and more than 150 articles in psychology, psychotherapy, sociology, politology, pedagogy and culturology. All researches are carry out with using of modern technologies.', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3642, 0, 1457, 0, 'Cultural and Educational Activities ', 'The Institute runs more 100 public lectures, workshops and meetings with the most prominent Russian and foreign intellectuals annually. Our lecturers participate and present some popular TV and radio programs. In the lobby we have regularly renewed art exhibition. \r\nSocial importance. By the beginning of 2001 the completing of Russian Healthcare system psychotherapists and clinical psychologists were correspondingly 19% and 3%.There are only two thousand graduated psychotherapists and about six thousand psychologists in Russia, whereas in the U.S. the same figures are correspondingly 80 and 180 thousands, that is as much as 30-40 times more. \r\n', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3643, 0, 1457, 0, 'Conferences.', 'For the last ten years the Institute organized four international conferences: 1995 â€“ â€œOne Hundred Years of Psychoanalysis. The Russian Roots, Repressions and Returning of Russia into International Psychoanalytical Communityâ€. 1998 â€“ â€œPsychoanalysis â€“ Literature â€“ Artâ€, 1999 â€“ â€œSigmund Freud in Context of Russian and Austrian Culturesâ€, 2001 â€“ â€œTen Years of Psychoanalysis in Russia: Russian Experienceâ€. In these conferences took part more than 200 foreign experts from Australia, Austria, the U.K., Germany, Holland, Israel, Italy, Canada, Norway, the U.S.A., Finland, France, South Africa, Armenia, Belorussia, Bolgaria, Georgia, Kazachstan, Latvia, Lithuania, Moldova, Poland, Ukraine and Estonia. Since 2000 the Institute is the methodological center of National Federation for Psychoanalysis consists of 20 local organizations.', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3644, 0, 1457, 0, 'Teaching Activities', ' such as lectures and seminars are accomplished by staff lectures and leading experts from psychoanalytical centers in the Great Britain, France, Germany, the U.S.A. and other countries. For students attendance of these extra curricula lectures (it is more than 200 academic hours annually ) is free of charge. The Institute-based training center for psychotherapists is the first in Russia.\r\nInternational bonds. \r\n', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3645, 0, 1457, 0, '0 Foundation', 'East-European Institute for Psychoanalysis founded on September 16 in 1991 is the first institution in Russia accomplishing psychoanalytical training of full value. The Institute was established as educational, methodological, scientific, consulting and cultural center. The Institute brings about training and retraining in the fields of psychology and psychotherapy, accomplishing graduating, postgraduating and supplementary educational programs. ', '', '', 'Press-Release_2001.pdf', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-28', 1),
