(3669, 0, 1477, 0, '1 Peter FonagyÂ´s Lecture at IPU 2017', 'Prof. Fonagy traces the intellectual history of the relationship between attachment theory and psychoanalytic thinking, and considers where we are now in the discourse between the two fields.\r\nHe will briefly describe some of the points of convergence, as well as areas of continuing contention, and suggest a future direction for attachment work which has a bearing on its relationship with psychoanalysis. Specifically, mentalizing theory will be discussed as a line of thinking that draws on both attachment ideas and psychoanalysis.\r\nRecent developments in the mentalizing approach will be described to highlight the continued relevance of attachment theory and\r\nthinking.', '', '', 'Fonagy_vortrag_flyer.pdf', '2017-06-18', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-07-04', 1),
