(3848, 0, 873, 0, 'In Memoriam Hans H. Strupp', 'KÃ¤chele H (2007) Hans H Strupp. Ein Pionier der Therapieforschung. Psychotherapeut 52: 152-153\r\n\r\nNachruf auf \r\nProf. em. Hans Strupp, Ph.D. Dr. med. h.c.\r\n\r\nHans Strupp ist im Oktober 2006 nach langer Erkrankung verstorben. Ihm wurde 1986 wegen seiner besonderen Verdienste um die empirische Psychotherapieforschung die EhrendoktorwÃ¼rde der medizinischen FakultÃ¤t unserer UniversitÃ¤t verliehen. Die internationale Psychotherapieforschung verliert in Hans Strupp einen liebenswerten Kollegen und ungemein produktiven Forscher. Mit der Abteilung Psychotherapie unserer UniversitÃ¤t war Hans Strupp, der 1921 in Frankfurt geboren wurde, besonders verbunden. Zusammen mit seiner Mutter konnte er als Jude noch kurz vor dem Ausbruch des zweiten Weltkriegs durch Flucht in die USA sein Leben in Sicherheit bringen. Nach seinem Psychologiestudium und Postgraduate-Weiterbildung an mehreren UniversitÃ¤ten lehrte und forschte er ab 1966 bis zu seiner Emeritierung als Distinguished Professor an der Vanderbilt University in Nashville / Tennessee. Eine seiner letzten Publikationen mit dem Titel â€žImplications of the Empirically Supported Treatment Movement for Psychoanalysisâ€œ ist als sein wissenschaftliches Testament zu betrachten. Dort hat er die Grenzen der manualisierten Psychotherapie, zu deren Entwicklung er selbst wesentlich beigetragen hat, aufgezeigt und deutlich gemacht, dass die zukÃ¼nftige Psychotherapieforschung den intersubjektiven Austausch zwischen Patient und Psychotherapeut in den Mittelpunkt stellen mÃ¼sse. Sein Wirken hat die Ausrichtung der Abteilung Psychotherapie unserer UniversitÃ¤t wesentlich beeinflusst. In seinen BÃ¼chern und mehr als 300 VerÃ¶ffentlichungen ist das klinische und wissenschaftliche Denken von Hans Strupp unvergÃ¤nglich geworden.\r\n', '', '', '', '2017-12-25', '', 'short', NULL, NULL, NULL, NULL, NULL, '2019-07-03', 1),
(3849, 0, 1320, 0, 'Bundesverdienstkreuz 1. Klasse', 'Ministerin Theresia Bauer: â€žProfessor Cierpka hat das Konzept der FruÌˆhen Hilfen fest etabliert. Sein Einsatz fuÌˆr prÃ¤ventive An-gebote und Kinderschutz hat vielen Kindern und Familien gehol-fen und unsere Gesellschaft insgesamt besser gemacht.â€œ', '', '', 'Prof._Dr._Manfred_Cierpka.pdf', '2017-12-26', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-12-26', 1),
