(1370, 204, 41, 'Wallerstein Robert', 'I was lucky to know Bob Wallerstein since 1976 when he was dean at the faculty for psychiatry at UCSF (University of California San Francisco) and I had a grant from the Swiss National fund for the advanced researchers. This time was very revealing in relation to expertise, tolerance innovation and psychoanalysis was still respected, specially because of people like Bob.\r\nit was a great experience to learn from him, to work with him, since he was beside all academic and analytic virtues a very loveable and witty person and in many respects he incorporared all German virtues, so the best traditions of my country survived at the pacific coast, because his father was clever enough to leave Berlin in the 1920th. \r\n   Rainer Krause (Berlin and SaarbrÃ¼cken) .', '2017-05-28', 1),
